import { Component } from '@angular/core';
import { ActivatedRoute, ParamMap } from '@angular/router'


@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.css']
})
export class NavbarComponent {
  navcatalogo = 'catalogo';
  navbuscar = 'buscar';
  navabout = 'about';
  navregcitas = 'citas-registradas';

  opcion!: string | null;

  constructor(private route: ActivatedRoute) {}

  ngOnInit(){
    this.route.paramMap.subscribe((params: ParamMap) => {
      this.opcion = params.get('opcion');
    });
  }
  
}
<nav class="navbar navbar-expand-lg">
    <div class="container-fluid">
        <a class="navbar-brand" [routerLink]="['/inicio']">Flick <span class="material-symbols-outlined">
                confirmation_number
            </span></a>
        <button class="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarNav"
            aria-controls="navbarNav" aria-expanded="false" aria-label="Toggle navigation">
            <span class="navbar-toggler-icon"></span>
        </button>
        <div class="collapse navbar-collapse" id="navbarNav">
            <ul class="navbar-nav">
                <li class="nav-item">
                    <a class="nav-link" aria-current="page" [routerLink]="['/inicio']" routerLinkActive="active">Inicio</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" [routerLink]="['/inicio', 'catalogo']" routerLinkActive="active">Catálogo</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" [routerLink]="['/inicio', 'about']" routerLinkActive="active">Sobre Nosotros</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" [routerLink]="['/inicio', navbuscar]" routerLinkActive="active">Buscar</a>
                </li>
                <li class="nav-item">
                    <a class="nav-link" [routerLink]="['/inicio', 'citas-registradas']" routerLinkActive="active">Citas registradas</a>
                </li>
            </ul>
        </div>
    </div>
</nav>
